/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<${scopeTag("ui5-list", tags, suffix)} .mode="${ifDefined(context.mode)}" .headerText="${ifDefined(context.headerText)}" .footerText="${ifDefined(context.footerText)}" .noDataText="${ifDefined(context.noDataText)}" .accessibleRole="${ifDefined(context._role)}" @ui5-item-click="${ifDefined(context._onListItemClick)}" @ui5-item-delete="${ifDefined(context._onListItemDelete)}" @ui5-selection-change="${ifDefined(context._onListSelectionChange)}" class="ui5-tree-root"><slot name="header" slot="header"></slot>${ repeat(context._listItems, (item, index) => item._id || index, (item, index) => block1(item, index, context, tags, suffix)) }</${scopeTag("ui5-list", tags, suffix)}> `;
const block1 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-li-tree", tags, suffix)} type="Active" level="${ifDefined(item.level)}" icon="${ifDefined(item.treeItem.icon)}" ?indeterminate="${item.treeItem.indeterminate}" additional-text="${ifDefined(item.treeItem.additionalText)}" additional-text-state="${ifDefined(item.treeItem.additionalTextState)}" title="${ifDefined(item.treeItem.title)}" ?_toggle-button-end="${ifDefined(context._toggleButtonEnd)}" ?_minimal="${ifDefined(context._minimal)}" .treeItem="${ifDefined(item.treeItem)}" .expanded="${ifDefined(item.treeItem.expanded)}" .selected="${ifDefined(item.treeItem.selected)}" .showToggleButton="${ifDefined(item.treeItem.requiresToggleButton)}" ._posinset="${ifDefined(item.posinset)}" ._setsize="${ifDefined(item.size)}" @ui5-toggle="${ifDefined(context._onListItemToggle)}" @ui5-step-in="${ifDefined(context._onListItemStepIn)}" @ui5-step-out="${ifDefined(context._onListItemStepOut)}" @mouseover="${context._onListItemMouseOver}" @mouseout="${context._onListItemMouseOut}">${ifDefined(item.treeItem.text)}</${scopeTag("ui5-li-tree", tags, suffix)}>`;


export default block0;
